import React from 'react';
import './stylesheets/App.css';
import Curve from "./Curve";

let curves = [];
let k = 0;

class App extends React.Component {
	render(){
    	return (<div>
    				<p>{k}</p>
    				<div>{[...curves]}</div><br/>
    				<newCurve/>
    			</div>);
  }  
}
class newCurve extends React.Component{
	render(){
		return (<button onclick={k++}> </button>);
	}
}

export default App;
